#include <cstdio>
#include <cstring>
#include <iostream>
#include <vector>
#include <string>
using namespace std;

class Solution {
public:
    bool wordBreak(string s, vector<string>& wordDict) {
        string temp="";
        int len=s.length();
        for (int i=0;i<len;i++){
            temp=temp+s[i];
            for (int k=0;k<wordDict.size();k++){
                if (temp==wordDict[k]){
                    if (check(s,i+1,len,wordDict)){
                        return true;
                    }
                }
            }
        }
        return false;    
    }

    bool check(string s,int start,int len,vector<string>& wordDict){
        if (start>=len){
            return true;
        }
        string temp="";
        for (int i=start;i<len;i++){
            temp=temp+s[i];
            for (int k=0;k<wordDict.size();k++){
                if (temp==wordDict[k]){
                    if (check(s,i+1,len,wordDict)){
                        return true;
                    }
                }
            }
        }
        return false;
    }
};

